ShipmentBatch::ImportStatusEnum ShipmentBatch::toImportStatusEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("NEW")) {
        return ImportStatusEnum::NEW;
    }
    
    if (value == utility::conversions::to_string_t("STARTED")) {
        return ImportStatusEnum::STARTED;
    }
    
    if (value == utility::conversions::to_string_t("FETCHING_DISTANCE_DATA")) {
        return ImportStatusEnum::FETCHING_DISTANCE_DATA;
    }
    
    if (value == utility::conversions::to_string_t("OPTIMIZING")) {
        return ImportStatusEnum::OPTIMIZING;
    }
    
    if (value == utility::conversions::to_string_t("CREATING_ROUTES")) {
        return ImportStatusEnum::CREATING_ROUTES;
    }
    
    if (value == utility::conversions::to_string_t("COMPLETED")) {
        return ImportStatusEnum::COMPLETED;
    }
    
    if (value == utility::conversions::to_string_t("INCOMPLETE")) {
        return ImportStatusEnum::INCOMPLETE;
    }
    
    throw std::invalid_argument("Invalid value for conversion to ImportStatusEnum");
}


const utility::string_t ShipmentBatch::fromImportStatusEnum(const ImportStatusEnum value) const
{
    switch(value)
    {
        
        case ImportStatusEnum::NEW: return utility::conversions::to_string_t("NEW");
        
        case ImportStatusEnum::STARTED: return utility::conversions::to_string_t("STARTED");
        
        case ImportStatusEnum::FETCHING_DISTANCE_DATA: return utility::conversions::to_string_t("FETCHING_DISTANCE_DATA");
        
        case ImportStatusEnum::OPTIMIZING: return utility::conversions::to_string_t("OPTIMIZING");
        
        case ImportStatusEnum::CREATING_ROUTES: return utility::conversions::to_string_t("CREATING_ROUTES");
        
        case ImportStatusEnum::COMPLETED: return utility::conversions::to_string_t("COMPLETED");
        
        case ImportStatusEnum::INCOMPLETE: return utility::conversions::to_string_t("INCOMPLETE");
        
    }
}


